import * as React from 'react';
import JohnZoscak from '../images/John-Zoscak.png';

import {Fade} from 'react-reveal';
import { Typography } from '@material-ui/core';

const Header = (props) => {
  return (
    <header>
      <div className='header'>
        <div className='header-text'>
          <Fade top>
            {/*<img src={JohnZoscak} alt='John Zoscak' />*/}
            <Typography variant='h4' color='textSecondary'>Hello, my name is</Typography>
            <Typography variant='h1' color='textSecondary'>John Zoscak</Typography>
          </Fade>
        </div>
      </div>
    </header>
  );
}
export default Header;
